import React from "react";
import {
  Container,
  Flex,
  FlexItem,
  FlexCentered
} from "../styles/general/General.styled";
import { SignUpImage } from "../styles/SignInOut.styled";
import Navbar from "./general/Navbar";
import { Form, Formik } from "formik";
import FormikTextField from "../../utils/FormikTextField";

const SignInOut = () => {
  const initialValues = {
    firstName: "",
    lastName: "",
    email: "",
    password: "",
    passwordConfirm: ""
  };

  return (
    <>
      <Navbar />
      <Container
        p="10rem 4rem"
        mh="100vh"
        bgColor="rgba(224, 247, 250, 0.8)"
        h="60%">
        <Flex bgColor="#f3e5f5" h="60vh" br="6rem">
          <FlexItem fg="1" h="60vh">
            <SignUpImage />
          </FlexItem>
          <FlexItem w="75%">
            <FlexCentered>
              <Formik
                initialValues={initialValues}
                onSubmit={(values, { setSubmitting, resetForm }) => {
                  setTimeout(() => {
                    setSubmitting(false);
                    // dispatch(registerUser(values));
                    resetForm();
                  }, 1500);
                }}>
                {({ values, errors, isSubmitting }) => (
                  <Grid container component="main" className={classes.root}>
                    <CssBaseline />
                    <Grid
                      item
                      xs={false}
                      sm={4}
                      md={7}
                      className={classes.image}
                    />
                    <Grid
                      item
                      xs={12}
                      sm={8}
                      md={5}
                      component={Paper}
                      elevation={6}
                      square>
                      <div className={classes.paper}>
                        <Icon className={classes.mapRoot}>
                          <img
                            className={classes.mapIcon}
                            src={movieIcon}
                            alt="Movie Icon"
                          />
                        </Icon>
                        <Typography
                          className={classes.signUp}
                          component="h1"
                          variant="h5">
                          Sign Up
                        </Typography>
                        <Form className={classes.form}>
                          <FormikTextField
                            label="First Name"
                            name="firstName"
                            type="input"
                          />
                          <FormikTextField
                            label="Last Name"
                            name="lastName"
                            type="input"
                          />
                          <FormikTextField
                            label="Email Address"
                            name="email"
                            type="email"
                          />
                          <FormikTextField
                            name="password"
                            label="Password"
                            type={showPw ? "text" : "password"}
                            className="passwordField"
                            InputProps={{
                              endAdornment: (
                                <InputAdornment>
                                  <IconButton
                                    onClick={() => setShowPw(!showPw)}>
                                    {showPw ? (
                                      <VisibilityOffIcon />
                                    ) : (
                                      <VisibilityIcon />
                                    )}
                                  </IconButton>
                                </InputAdornment>
                              )
                            }}
                          />
                          <FormikTextField
                            name="passwordConfirm"
                            label="Confirm Password"
                            type={showConfirmPw ? "text" : "password"}
                            className="passwordField"
                            InputProps={{
                              endAdornment: (
                                <InputAdornment>
                                  <IconButton
                                    onClick={() =>
                                      setShowConfirmPw(!showConfirmPw)
                                    }>
                                    {showConfirmPw ? (
                                      <VisibilityOffIcon />
                                    ) : (
                                      <VisibilityIcon />
                                    )}
                                  </IconButton>
                                </InputAdornment>
                              )
                            }}
                          />
                          <Button
                            type="submit"
                            fullWidth
                            variant="contained"
                            color="primary"
                            disabled={isSubmitting}
                            className={classes.submit}>
                            Sign Up
                          </Button>
                          <Grid container>
                            <Grid item>
                              <Link to="/login">
                                Already have an account? Sign In
                              </Link>
                            </Grid>
                          </Grid>
                          <Box mt={5}>
                            <Copyright />
                          </Box>
                          {/* <pre>{JSON.stringify(values, null, 2)}</pre>
                <pre>{JSON.stringify(errors, null, 2)}</pre> */}
                        </Form>
                      </div>
                    </Grid>
                  </Grid>
                )}
              </Formik>
            </FlexCentered>
          </FlexItem>
        </Flex>
      </Container>
    </>
  );
};

export default SignInOut;
